import React from "react";
import data from "./data.json";

const JobFeatures = (props) => {
  return data.map((x, i) => {
    return (
      <div>
        <div className="parentJobDiv">
          <div className="logo">
            <img src={props.logo} alt="logo" />
          </div>
          <div className="cardInformation">
            <h3 className="companyName">
              {props.name} <span className="new">{props.new}</span>
              <span className="featured">{props.featured}</span>
            </h3>
            <h1 className="title">{props.title}</h1>
            <p className="jobInformation">
              {props.time} . {props.contract} . {props.location}
            </p>
          </div>
        </div>
        {/* <div></div> */}
      </div>
    );
  });
};

export default JobFeatures;
